Action Comics (1938-2011) #770
&quot;Emperor Joker&quot; part 5, continued from Superman: The Man of Steel #105. The battle is over and the obscenely powerful Emperor holds the upper hand. As evil wins and good faces ultimate defeat, is this the ultimate Bizarro ending? Superman versus Joker for the fate of the universe in the stunning conclusion!

Action Comics (1938-2011) #776
&quot;Return to Krypton&quot; part 4, continued from Superman: The Man of Steel #111. It looks like there's no way home for Superman and Lois. But General Zod will bring about the planet's destruction rather than let anyone escape!

Action Comics (1938-2011) #780
&quot;Our Worlds at War&quot; part 4, continued from Superman: The Man of Steel #115. A man who has tried to kill Superman in the past is now out to start a World War as his band of marauders begins to level Berlin. The Man of Steel confronts his new foe in a destructive fight that can only end with even more death! Continued in Superman v2 #172.

Action Comics (1938-2011) #781
&quot;Our Worlds at War&quot; part 8, continued from Superman: The Man of Steel #116. Superman is torn in many directions as Imperiex's probes continue to ravage Earth. Meanwhile, Lois and the President deal with their unearthly terrors, and the MASH unit in space faces its own assault with only the injured JLA able to protect it. Continued in Superman v2 #173.

Action Comics (1938-2011) #782
&quot;Our Worlds at War&quot; part 12, continued from Superman: The Man of Steel #117. Having undergone a radical transformation, the new Superman now may have the power to actually stop the War. But in doing so, has he become a greater danger to the Universe? It all ends here one way or another!

Action Comics (1938-2011) #793
&quot;Return to Krypton II&quot; part 4, continued from Superman: The Man of Steel #128. It's all-out war on Krypton, and to make things worse, the planet's red sun is expanding, threatening to engulf the world. Will Superman witness his homeworld die one more time?

Action Comics (1938-2011) #811
&quot;Strange New Visitor&quot; part 1! Superman is missing and Metropolis is facing a new crisis! The rest of Superman Family--Superboy, the new Steel, and Krypto--do what they can to save the city, but this looks like a job for...Mr. Majestic!? Continued in Adventures of Superman v1 #624.

Action Comics (1938-2011) #836
&quot;This is your Life, Superman&quot; part 2, continued from Superman v2 #226. Superman is caught by the one person he can't defeat: Lois Lane! Witness the undying love story of the greatest couple of Earth-2, and how their love could bring about the end of the universe. Continued in Adventures of Superman v1 #649.

